    false,nt"url": null,nt"notes": "The Lower Souris Migratory Waterfowl Refuge
    (now known as the J. Clark Salyer National Wildlife Refuge) is located just south
    of the Canadian border in North Dakota. The refuge was established and constructed
    by the CCC in 1935 to restore waterfowl habitat. This report gives an overview of
    events taking place on the refuge in July of 1935. The report begins with a brief
    description of the refuge including photographs of the different habitats that are
    found. Progress is being made on the recruitment of waterfowl. The nesting and rearing
    conditions for ducks on the refuge were much better than in previous years; a table
    of observed broods is included. Predation is still an area to be monitored, though
    most of the predators in the area during July were beneficial or in such low numbers
    they were little cause for concern. Cover of grasses and weeds were especially abundant
    due to the plentiful rains the refuge received. Wildlife and habitat improvements
    continued through construction of nesting islands and boxes as well as plantings
    for waterfowl food.",nt"license_title": "License Not Specified",nt"extras":
